import React, { Component } from 'react';
import { Tabs } from '@tableau/tableau-ui'


const configuration = <>
                        <span>Test Configuration</span><br/>
                        <span>Test Configuration2</span><br/>
                        <span>Test Configuration3</span><br/>
                      </>;

const options = <>
                    <span>Test options</span>
                    <span>Test options2</span>
                </>;
const formatting = <span>Test formatting</span>;
const panels = [configuration, options, formatting];

const tabs = [ { content: 'Four' }, { content: 'Five' }, { content: 'Six' } ];

class TabsLeftAlign extends Component {

    componentWillMount() {
        this.setState({ selectedTabIndex: 0 });
    }

    render() {

        return(
            <>

            <br/>
            <Tabs
            activation='manual'
            alignment='left'
            onTabChange={(index) => {
                console.log(`onChange: ${index}`);
                this.setState({ selectedTabIndex: index });
            }}
            selectedTabIndex={this.state.selectedTabIndex}
            tabs={tabs}
            >

            {/*<span>{tabs[this.state.selectedTabIndex].content} panel content</span>*/}
            {panels[this.state.selectedTabIndex]}
            </Tabs>

            <br/>
            </>
        )
    }
}

export default TabsLeftAlign
